		"description": "<p>Ven a jugar a juegos de mesa con nosotros. Si no sabes de juegos no te preocupes que constantemente aprendemos nuevos juegos y explicamos las reglas de los que sabemos.</p> <p>Este evento lo realizamos en dentro del Casal de Teixonera, mediante la cesión de espacio de la asociación de juegos de mesa BarnaJocs. El sitio esta cerca de la parada de metro <b>\"El Coll - La Teixonera\" L5</b> (salida Arenys, coger el ascensor que va arriba del todo después de salir por las vallas/taquillas) y no mucho más lejos de la parada de <b>\"Vall d'Hebron\" L5 y L3</b>. Si vas en coche te recomiendo que pases por el carrer de Coll i Alentorn, en el que suele poderse aparcar el fin de semana.</p> <p>Se puede traer o pedir comida, pero que sepáis que<b> traemos latas frías a 1€</b> (lo poco recaudado es para juegos de mesa).</p> <p>A medida que se llega se distribuye la gente en mesas y se elige lo que jugar entre los integrantes de la mesa y los juegos disponibles (de momento los traemos los socios).</p> <p>No importa si eres jugador habitual o esporádico siempre que estés dispuesto a probar juegos nuevos, y si llevas un juego de mesa y nos enseñas a jugar a uno que no hayamos jugado aun pues mejor (no necesario, claro, y comentad que lleváis para no repetirnos) ;)</p> <p>El evento estará abierto a cualquiera que quiera unirse, así que podéis traer amigos como invitados adicionales pero apuntándose siempre para respetar el aforo.</p> <p>Puedes venir más tarde de la hora de inicio pero te tendrás que esperar que se termine alguna partida en curso o que venga alguna otra persona para jugar. Y te vas cuando quieras, aunque intenta proveer no tener que dejar a medias una partida si ves que te iras antes de comenzarla.</p> <p>Agradeceríamos que <b>siempre que vengas te apuntes siempre como asistente y si luego no vas te desapuntes en cuanto lo sepas</b> (con la aplicación del móvil es un momento apuntarse), gracias.</p> <p><b>Instamos a los no socios a donar por lo menos 1€ por día </b>para ir comprando nuevos juegos poco a poco, para disfrute de todos</p> <p><br/>Os esperamos ;)</p> ",
