		"link": "https://www.meetup.com/BarcelonaHikingGroup/events/234915160/",
		"description": "<p>Hola hikers,</p> <p>    aprovechando el último día de horario de verano propongo a los que no tenemos \"puente\" una ruta circular a través de la Serra de Catllaràs en la comarca del Berguedà.</p> <p>Puntos interesantes:</p> <p>*   Caminar por senderos rodeados de bosques en otoño. Un placer para los sentidos...</p> <p>*   Constatar que hasta donde hay pistas forestales llega el homo-boletaire.</p> <p>*   Conocer el enclave privilegiado del refugio de Ardericó donde pararemos a comer (opción de cerveza, etc, quien quiera...)</p> <p>*   Grimpar hasta las 2 cimas de la Roca Forcada disfrutando de vistas espectaculares.</p> <p>*   Regresar al punto de partida sin encontrarnos a nadie aunque parezca mentira.</p> <p>*   Complemetar el hike que organizó Joost el pasado febrero.</p> <p><br/>La ruta y información (en catalán) la tenéis en este enlace, leedlo con atención aunque se realizó en invierno y nosotros la haremos casi en veranito:</p> <p><a href=\"http://www.engarrista.com/node/584\">Track</a></p> <p><img src=\"http://photos3.meetupstatic.com/photos/event/3/6/7/7/600_455413943.jpeg\" /></p> <p>\n\n\n<img src=\"http://photos1.meetupstatic.com/photos/event/3/6/8/f/600_455413967.jpeg\" /></p> <p>\n\n\nLa ruta requiere un nivel físico bueno.<b> No podemos entretenernos mucho porque la ruta es larga y quiero evitar llegar de noche, por lo tanto el ritmo no podrá ser lento ni haremos demasiadas paradas, espero vuestra comprensión en este punto. Hay la opción de hacer alguna grimpada, pero no será obligatoria ya que quedan fuera de la ruta circular.</b></p> <p><b>FICHA:<br/></b></p> <p><b>Lugar de salida: Monestir de Lillet, La Pobla de Lillet (Berguedà)</b></p> <p><b>Distancia: 13,2 Km</b></p> <p><b>Desnivel positivo: 1.060 metros</b></p> <p><b>Tiempo: 7 hores</b></p> <p><b>Dificultad física: Medium<br/></b></p> <p><b>Dificultad técnica: Medium (hay pequeñas grimpadas algo expuestas, pero optativas)</b></p> <p><br/><b>Desplazamiento:</b></p> <p>Nos encontramos en la estación de RENFE Sant Andreu. Salimos desde allí en coche. El trayecto aprox. coches para l@s conductor@s:</p> <p><a href=\"https://www.google.com/maps/dir/Sant+Andreu+Arenal,+Barcelona,+Spain/08696+La+Pobla+de+Lillet,+Barcelona,+Spain/@41.8179044,1.5031847,9z/data=!3m1!4b1!4m13!4m12!1m5!1m1!1s0x12a4bd27e0387f09:0x445ac81819abdd40!2m2!1d2.183104!2d41.430851!1m5!1m1!1s0x12a5729119907e8f:0xe8b33c6efd515091!2m2!1d1.9753088!2d42.2445647\">Trayecto coches</a></p> <p><br/>Atención, los últimos 2 Km se hacen por una pista de tierra, pero apta para turismos yendo con cuidado.</p> <p><br/>Pararemos a desayunar en plan rapidito.</p> <p><br/>El coste por coche será de 60€, dividido entre todos los ocupantes. Incluye los peajes de autopista.</p> <p>Una vez tenga más coches disponibles ampliaré el grupo. Quien pueda traer coche que lo indique en la respuesta y mante un mensaje al grupo. Gracias.</p> <p><br/><b>Material:</b></p> <p><br/>* Preferible botas de montaña más que zapatillas.<br/>* Agua: 1,5 l.<br/>* <b>Linterna frontal</b><br/>* Comida<br/>* Guantes, gorro<br/>* Palos, si los tienes<br/>* Ropa de abrigo/lluvia<br/>* Silbato, manta térmica</p> <p><i><b>FAQ:</b></i></p> <p><i>• No estoy seguro(a) de venir, pero me apunto, luego veré? Por favor evitar esto, y recuerda que los No Shows se aplican a partir de las 48 horas antes de la salida!</i></p> <p><i>• El tiempo máximo de espera en el punto de encuentro es de 15 minutos.</i></p> <p><i>• Para el tiempo, mira  <a href=\"http://www.meteo.cat/prediccio/municipal/081666\">METEOCAT</a><br/></i></p> <p><i><b>OBSERVACIÓN IMPORTANTE:</b></i></p> <p><i>Esta actividad no la propone ninguna empresa ni guía profesional, simplemente se hace pública para invitar a quien quiera acompañarme en ella, lo cual implica:</i></p> <p><i>•  El organizador no obtiene ninguna ganancia económica</i></p> <p>• <i> Cada participante es responsable de evaluar si su nivel físico y técnico es el adecuado para la actividad ( una buena manera es contrastar su propia experiencia con los Datos Técnicos que se dan en la Descripción )</i></p> <p>• <i> El recorrido puede no estar señalizado o bien definido en algunas de sus partes, por lo que en algunas ocasiones puede llegar a generar una sensación de pérdida o descontrol temporal al tener que explorar caminos, volver atrás e incluso provocar la alteración de la ruta prevista lo que puede así mismo provocar cambios en la Distancia y Desnivel realizados e incrementar la dificultad y duración del hike</i></p> <p>• <i> En ningún caso, la persona que propone la actividad podrá ser considerada responsable de posibles daños o perjuicios derivados de la participación en ella. Existe un seguro específico para el excursionismo. Puedes informarte sobre en la</i> <a href=\"http://www.feec.org/\"><i>FEEC</i></a> </p> <p><i>El hecho de apuntarte a este evento implica que has leído y entendido toda la propuesta. AL UNIRTE A ESTE EVENTO ACEPTAS TODAS LAS</i> <a href=\"http://www.barcelonahikinggroup.com/about/\"><i>NORMAS DEL GRUPO</i></a><i>. Si tienes dudas puedes preguntarme lo que quieras sobre el evento.</i></p> <p>IT IS ALWAYS IMPORTANT THAT YOU BRING THE RIGHT GEAR AND BEHAVE PROPERLY. FOLLOW THIS <a href=\"http://www.meetup.com/BarcelonaHikingGroup/pages/Essentials/\">LINK</a>(<a href=\"http://www.meetup.com/BarcelonaHikingGroup/pages/Guia_basica/?name=Guia_basica\">HERE IN SPANISH</a>), WHERE YOU CAN FIND A GUIDE ABOUT THESE TOPICS.</p> ",
